import logo from "./logo.svg";
import "./App.css";
import "./styles.css";

function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}

function Header() {
  return (
    <div className="logo">
      <img src="lezhin.png" alt="Lezhin Logo" />;
    </div>
  );
}

export default App;
